import styled from 'styled-components';

const Toast = () => {
  return <Container></Container>;
};
export default Toast;

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #f3f4f6;
  padding: 16px;
  border-radius: 8px;
  width: 90%;
`;
